    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Log in!{% endblock %}

{% block body %}
<div class=\"container d-flex align-items-center justify-content-center\">
    <div class=\"row text-center pt-5\">
        <div class=\"card\" style=\"width: 18rem;\">
        <div class=\"card-body\">
            <form method=\"post\">
                {% if error %}
                    <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
                {% endif %}

                {% if app.user %}
                    <div class=\"mb-3\">
                        You are logged in as {{ app.user.username }}, <a href=\"{{ path('app_logout') }}\">Logout</a>
                    </div>
                {% endif %}
            
                <h1 class=\"h3 mb-3 font-weight-normal\">Iniciar Sesión</h1>
                <hr/>
                <label class=\"mb-3 mr-auto\">Correo</label>
                <input type=\"email\" value=\"{{ last_username }}\" name=\"email\" id=\"inputEmail\" class=\"form-control mb-3\" placeholder=\"\" required autofocus>
                <label class=\"mb-3 text-left\">Contraseña</label>
                <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control mb-3\" placeholder=\"\" required>

                <input type=\"hidden\" name=\"_csrf_token\"
                    value=\"{{ csrf_token('authenticate') }}\"
                >
                <button class=\"btn btn-lg btn-primary\" type=\"submit\">
                    Enviar
                </button>
            </form>
        </div>
    </div>
</div>
{% endblock %}
